function VideoViewModel(){var n=this;n.listAlbum=ko.observableArray([]);n.id=ko.observable("");n.seoLink=ko.observable("");n.listVideo=ko.observableArray([]);n.totalRows=ko.observable(0);n.pageSize=ko.observable(9);n.currentPage=ko.observable(1);n.totalPage=ko.observable(1);n.listPage=ko.observableArray([]);n.selectAlbum=function(t){n.seoLink(t.SeoLink);n.id(t.Id);setTimeout(()=>{n.currentPage(1),n.getVideo(n.seoLink())},200)};n.getVideo=function(){$.get("/get-video-by-album",{seoLink:n.seoLink(),page:n.currentPage(),pageSize:n.pageSize()},function(t){if(t){if(n.listVideo(t.items),n.totalRows(t.totalRows),n.totalPage(Math.ceil(n.totalRows()/n.pageSize())),n.listPage([]),n.totalPage()>1)for(var i=1;i<=n.totalPage();i++)n.listPage.push({page:i})}else n.listPage([]),n.listVideo([]);console.log(n.listVideo())})};n.checkUrlVideo=function(n){return console.log(n),n.indexOf("uploads/")>-1?!0:!1};n.search=function(t){n.currentPage(t.page);n.getVideo(n.seoLink());$("html, body").animate({scrollTop:$("#abums").offset().top-50},1e3)};n.firstPage=function(){n.currentPage(1);n.getVideo(n.seoLink());$("html, body").animate({scrollTop:$("#abums").offset().top-50},1e3)};n.lastPage=function(){n.currentPage(n.totalPage());n.getVideo(n.seoLink());$("html, body").animate({scrollTop:$("#abums").offset().top-50},1e3)};n.prevPage=function(){n.currentPage(n.currentPage()-1);n.getVideo(n.seoLink())};n.nextPage=function(){n.currentPage(n.currentPage()+1);n.getVideo(n.seoLink());$("html, body").animate({scrollTop:$("#abums").offset().top-50},1e3)};$(document).ready(function(){n.listAlbum(listAlbum);n.currentPage(1);window.innerWidth<768&&n.pageSize(7);n.listAlbum()&&n.listAlbum().length>0&&(n.id(n.listAlbum()[0].Id),n.seoLink(n.listAlbum()[0].SeoLink),n.getVideo(n.seoLink()))})}var viewModel=new VideoViewModel;ko.applyBindings(viewModel,document.getElementsByClassName("album-videos")[0]);